import { Button, List, ListItem, ListItemButton, ListItemText, Typography } from "@mui/material"
import AddHomeIcon from '@mui/icons-material/AddHome';
import style from './SolicitaServico.module.scss';
import { Box } from "@mui/system";
import React from "react";

const botao = [
    "Teste1",
    "Teste2",
    'Teste3'
]

export const SolicitaServico = () => {

    const normalize = {
    }

    const Ativo = (e) => {
        e.preventDefault()
        let a = e.target.value
        let t = document.getElementById(botao[a])
        console.log(t);
    }

    const [selectedIndex, setSelectedIndex] = React.useState(1);

  const handleListItemClick = (event, index) => {
    setSelectedIndex(index);
  };

    return (
        <>
            <Typography variant='h6'>Selecione o servi√ßo desejado</Typography>
            <div className={style.opcoes}>
                <Box sx={{ width: '25%', bgcolor: 'background.paper' }}>
                    <nav aria-label="secondary mailbox folders">
                        <List component="nav" aria-label="secondary mailbox folder">
                            <ListItemButton
                                selected={selectedIndex === 2}
                                onClick={(event) => handleListItemClick(event, 2)}
                            >
                                <ListItemText primary="Trash" />
                            </ListItemButton>
                            <ListItemButton
                                selected={selectedIndex === 3}
                                onClick={(event) => handleListItemClick(event, 3)}
                            >
                                <ListItemText primary="Spam" />
                            </ListItemButton>
                        </List>
                    </nav>
                </Box>
                <Box sx={{ width: '33%', bgcolor: 'background.paper' }}>
                    <nav aria-label="secondary mailbox folders">
                        <List component="nav" aria-label="secondary mailbox folder">
                            <ListItemButton
                                selected={selectedIndex === 2}
                                onClick={(event) => handleListItemClick(event, 2)}
                            >
                                <ListItemText primary="Trash" />
                            </ListItemButton>
                            <ListItemButton
                                selected={selectedIndex === 3}
                                onClick={(event) => handleListItemClick(event, 3)}
                            >
                                <ListItemText primary="Spam" />
                            </ListItemButton>
                        </List>
                    </nav>
                </Box>
                <Box sx={{ width: '33%', bgcolor: 'background.paper' }}>
                    <nav aria-label="secondary mailbox folders">
                        <List component="nav" aria-label="secondary mailbox folder">
                            <ListItemButton
                                selected={selectedIndex === 2}
                                onClick={(event) => handleListItemClick(event, 2)}
                            >
                                <ListItemText primary="Trash" />
                            </ListItemButton>
                            <ListItemButton
                                selected={selectedIndex === 3}
                                onClick={(event) => handleListItemClick(event, 3)}
                            >
                                <ListItemText primary="Spam" />
                            </ListItemButton>
                        </List>
                    </nav>
                </Box>
            </div>
        </>
    )
}
